White Goodman (Stiller) is the owner and founder of Globo Gym, and would love nothing more than owning Average Joe&amp;#039;s Gymnasium. Peter LaFleur (Vaughn) doesn&amp;#039;t want to lose his gym to Goodman, but couldn&amp;#039;t find anyway to get $50,000 in time. Peter and his gang of gym buddies, think of ways to raise money, finally settling on winning a dodgeball tournament. White Goodman even creates his own dodgeball team to finish off Peter. Peter&amp;#039;s team doesn&amp;#039;t do too well, that is until legendary ADAA champ Patches O&amp;#039;Houlihan (Torn) turns up ready to train them.
